import React, { Component } from 'react';
import Headline from './components/Headline';
import PokemonCard from './components/PokemonCard';
import pokemons from './data/DataPokemons';

class App extends Component {

  constructor() {
    super()

  }

  render(){
    return(
      <>
        <header>
          <Headline type="title" text="Pokedex" addClass=" " />
          <Headline type="subtitle" text="Pokemon Center" />
        </header>
        <main>
          <section>
            <ul>
              {pokemons.map((poke) => <PokemonCard id={poke.id} name={poke.name} image={poke.img} type={poke.type} weight={poke.averageWeight} />
              )}
            </ul>
          </section>
        </main>
      </>
    );
  }
}

export default App;
